import './App.css';
import SideMenuBar from './Components/SideMenuBar';
import CustomersList from './Customer-Screens/CustomerList';
import CustomerInfo from './Customer-Screens/CustomerInfo';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <SideMenuBar/>
      <CustomersList/>
      <Router>
      <Switch>
        <Route exact path="/customersList" component={CustomersList} />
        <Route path="/customer/:id" component={CustomerInfo} />
      </Switch>
    </Router>
    </div>
  );
}

export default App;
